      <th>Amount</th>
      <th>Currency</th>
    </tr>
  </thead>


  <tbody>
    <tr>
    {friends.map(({avatar, name, isOnline, id}) => (
          <FriendListItem 
          key={id}
          avatar ={avatar} 
          name={name} 
          isOnline={isOnline}
          />
        ))}


      <td>{type}</td>
      <td>{amount}</td>
      <td>{currency}</td>
    </tr>
    <tr>
      <td>{type}</td>
      <td>{amount}</td>
      <td>{currency}</td>
    </tr>
  </tbody>
</table>
    )
}
